  const [svg, setSvg] = useState("");

  useEffect(() => {
    // Returns a promise
    Convert(svgFile).then((svg) => setSvg(svg));
  }, []);

  return (
    <>
      {/* Will display your converted code for copying as well as your svg */}
      {svg && SVGElement}
    </>
  );
}

